import React from 'react';
import classes from '../styles/Input.module.css';

export const Input = () => {
    return (
        <>
        <div className={classes.input} htmlFor="amount">
            <label htmlFor="amount">Amount</label>
            <input className={classes.input} type="number" placeholder='1' name='amount' min='1'/>
        </div>

        </>
    )
}
